import React from "react";
import ContactCard from "./ContactCard";
import { SideNavBar } from "./Navbar";

function ContactContainer({ currentUser, userData }) {

    const contactsIds = currentUser.contacts.map((contact) => contact.contactid);
    const contacts = userData.filter((user) => contactsIds.includes(user.id));

    const contactCardsDisplay = contacts.map((contact) => {
        const currentUserContactData = currentUser.contacts.filter((userContact) => userContact.id === contact.id);
        const notes = currentUserContactData.privateNotes;
        const circ = currentUserContactData.circle;
        return <ContactCard key={`${contact.username}card`} user={contact} privNotes={notes} circle={circ} />;
    });

    return (
        <div>
            <SideNavBar />
            {contactCardsDisplay}
        </div>
    );
};

export default ContactContainer;

/*
use conditional programming to return components dependent on logInData
